import React from "react";
import "./Contact.css";

function Contact() {
  return (
    <div className="contact-container">
      <h1>Contact</h1>
      <p>Let's get in touch</p>
      <div>
        <i class="fa-regular fa-envelope"></i>
      </div>
      <div></div>
    </div>
  );
}

export default Contact;
